/**
 *
 * @param date | de la forme yyyy-mm-jj hh:mm:ss.mmm
 * @returns | Le format attendu par le champ input est jj-mm-yyyy
 */
const reParsedDate = (date: string) => {
  let a = new Date(date);
  let table = a.toLocaleDateString().split("/");
  return table.reverse().join("-");
};

